import React from "react";
import axios from "axios";

const baseURL = "https://jsonplaceholder.typicode.com/posts/1";

function App() {
  const [post, setPost] = React.useState(null);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      console.log(post)
      setPost(response.data);
    });
  }, []);

  if (!post) return null;

  return (
    <div>
      <h2>GA SEI-33</h2>
      <h1>{post.title}</h1>
      <p>{post.body}</p>
    </div>
  );
}

export default App;
